INSERT INTO "PrinterLineItems" ("Id","InvoiceID","InitialProdDescription","Qty","Destination","OrderGroupID","SubItemID")
VALUES 
	 {{appsmith.store.newList.map((d) => { 
	return"(" + "'printer_item_" + d.id+ "', " + "(SELECT i.\"InvoiceID\" FROM \"public\".\"Invoice\" i INNER JOIN \"public\".\"Customers\" c1 ON ( c1.\"Id\" = i.\"CustomerID\")  WHERE i.\"InvoiceDate\" >= '"+ moment(DatePicker1.selectedDate).format("YYYY-MM-DD") +"' AND	c1.\"OrgID\" = '" + d.orgID + "')," + "'" + d.productDesc + "'," + d.quantity + " ,'" + d.destinationCountryCode + "'," + "'" + d.groupID + "'," + (d.parentID === null ? null : `'printer_item_${d.parentID}'`) + ")"}).join(",")  }};
